CREATE DATABASE /*!32312 IF NOT EXISTS*/`rdc_wechat` /*!40100 DEFAULT CHARACTER SET utf8 */;

USE `rdc_wechat`;

/*Table structure for table `circle_manage` */

DROP TABLE IF EXISTS `circle_manage`;

CREATE TABLE `circle_manage` (
  `id` int(100) NOT NULL AUTO_INCREMENT,
  `circleid` int(50) DEFAULT NULL,
  `goodCount` int(20) DEFAULT NULL,
  `comment` varchar(30) DEFAULT NULL,
  `userName` varchar(30) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `circleid` (`circleid`),
  CONSTRAINT `circle_manage_ibfk_1` FOREIGN KEY (`circleid`) REFERENCES `user_cirle` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `circle_manage` */

/*Table structure for table `circle_picture` */

DROP TABLE IF EXISTS `circle_picture`;

CREATE TABLE `circle_picture` (
  `id` int(100) NOT NULL AUTO_INCREMENT COMMENT '用户id',
  `pictureUrl` varchar(500) DEFAULT NULL COMMENT '图片地址',
  PRIMARY KEY (`id`),
  CONSTRAINT `circle_picture_ibfk_1` FOREIGN KEY (`id`) REFERENCES `user_cirle` (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `circle_picture` */

/*Table structure for table `friends_request` */

DROP TABLE IF EXISTS `friends_request`;

CREATE TABLE `friends_request` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `uid` int(11) NOT NULL COMMENT '被申请用户id userid',
  `sid` int(11) NOT NULL COMMENT '好友申请人id',
  `text` varchar(50) NOT NULL COMMENT '附言',
  `icon` int(10) DEFAULT NULL COMMENT '是否是验证消息1为是0为否',
  `ifRead` int(10) DEFAULT '0' COMMENT '是否已读1为是0为否',
  PRIMARY KEY (`id`),
  KEY `uid` (`uid`),
  KEY `sid` (`sid`),
  CONSTRAINT `friends_request_ibfk_1` FOREIGN KEY (`uid`) REFERENCES `mywechat_user` (`id`),
  CONSTRAINT `friends_request_ibfk_2` FOREIGN KEY (`sid`) REFERENCES `mywechat_user` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

/*Data for the table `friends_request` */

insert  into `friends_request`(`id`,`uid`,`sid`,`text`,`icon`,`ifRead`) values 
