/*Table structure for table `mywechat_message` */

DROP TABLE IF EXISTS `mywechat_message`;

CREATE TABLE `mywechat_message` (
  `id` int(50) NOT NULL AUTO_INCREMENT,
  `m_message` text,
  `from_id` int(50) NOT NULL,
  `poat_id` int(50) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `from_id` (`from_id`),
  KEY `poat_id` (`poat_id`),
  CONSTRAINT `mywechat_message_ibfk_1` FOREIGN KEY (`from_id`) REFERENCES `mywechat_user` (`id`),
  CONSTRAINT `mywechat_message_ibfk_2` FOREIGN KEY (`poat_id`) REFERENCES `mywechat_user` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `mywechat_message` */

/*Table structure for table `mywechat_role` */

DROP TABLE IF EXISTS `mywechat_role`;

CREATE TABLE `mywechat_role` (
  `id` int(20) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `roleCode` varchar(15) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '角色编码',
  `roleName` varchar(15) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '角色名称',
  `createdBy` bigint(20) DEFAULT NULL COMMENT '创建者',
  `creationDate` datetime DEFAULT NULL COMMENT '创建时间',
  `modifyBy` bigint(20) DEFAULT NULL COMMENT '修改者',
  `modifyDate` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `mywechat_role` */

insert  into `mywechat_role`(`id`,`roleCode`,`roleName`,`createdBy`,`creationDate`,`modifyBy`,`modifyDate`) values 
(1,'WECHAT_ADMIN','系统管理员',NULL,'2016-04-13 00:00:00',NULL,NULL),
(2,'WECHAT_USER','用户',NULL,'2016-04-13 00:00:00',NULL,NULL),
(3,'WECHAT_COMMON','游客',NULL,NULL,NULL,NULL);

/*Table structure for table `mywechat_user` */

DROP TABLE IF EXISTS `mywechat_user`;

CREATE TABLE `mywechat_user` (
  `id` int(20) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `userCode` varchar(15) COLLATE utf8_unicode_ci NOT NULL COMMENT '用户账号',
  `userName` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '用户昵称',
  `userPassword` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '用户密码',
  `age` varchar(3) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '年龄',
  `gender` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '性别',
  `birthday` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '出生日期',
  `userEmail` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '用户电子邮件',
  `address` varchar(30) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '地址',
  `userRole` int(20) NOT NULL DEFAULT '2' COMMENT '用户角色（取自角色表-角色id）',
  `userHead` longblob COMMENT '头像',
  PRIMARY KEY (`id`),
  KEY `userRole` (`userRole`),
  CONSTRAINT `mywechat_user_ibfk_1` FOREIGN KEY (`userRole`) REFERENCES `mywechat_role` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

