/*Table structure for table `user_cirle` */

DROP TABLE IF EXISTS `user_cirle`;

CREATE TABLE `user_cirle` (
  `id` int(50) NOT NULL AUTO_INCREMENT,
  `des` text COMMENT '朋友圈文案',
  `img` varbinary(500) DEFAULT NULL COMMENT '朋友圈图片',
  `user_id` int(50) DEFAULT NULL COMMENT '作者id',
  `goodCount` int(100) DEFAULT NULL COMMENT '朋友圈点赞',
  `comment` varchar(100) DEFAULT NULL COMMENT '朋友圈评论',
  `date` date DEFAULT NULL COMMENT '发表时间',
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`),
  CONSTRAINT `user_cirle_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `mywechat_user` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

