/*Table structure for table `user_friends` */

DROP TABLE IF EXISTS `user_friends`;

CREATE TABLE `user_friends` (
  `id` int(100) NOT NULL AUTO_INCREMENT,
  `f_id` int(50) NOT NULL COMMENT '朋友id',
  `f_userid` int(50) NOT NULL COMMENT '用户id',
  `f_name` varchar(50) DEFAULT NULL COMMENT '设置朋友昵称',
  `ifBlack` int(10) DEFAULT '1' COMMENT '是否是黑名单的人1否0是',
  PRIMARY KEY (`id`),
  KEY `f_id` (`f_id`),
  KEY `f_userid` (`f_userid`),
  CONSTRAINT `user_friends_ibfk_1` FOREIGN KEY (`f_id`) REFERENCES `mywechat_user` (`id`),
  CONSTRAINT `user_friends_ibfk_2` FOREIGN KEY (`f_userid`) REFERENCES `mywechat_user` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

